import { ListRowLongTextType, L, ListRowInputType, ListRowButtonType, ListRow } from '@ui/common/element/muListRow';

const HomePostToMUSection = props => {
  return <div {...props}>
    <h2>Contact to MU!</h2>
    <Card>
      <ListRow label='성함'></ListRow>
      <ListRow label='연락처'></ListRow>
      <ListRow label='문의 유형'></ListRow>
      <ListRow label='상세 내용'></ListRow>
      qweqwe<br />
      qweqwe<br />
      qweqwe<br />
      qweqwe<br />
      qweqwe<br />
      qweqwe<br />
    </Card>
  </div>;
};

export { HomePostToMUSection };
